import { useEffect } from "react";

const DynamicTable = (sqlData) => {

    const column = Object.keys(sqlData[0]);

    const ThData =()=>{
        return column.map((data)=>{
            return <th key={data}>{data}</th>
        })
    }

    const tdData =() =>{
   
        return sqlData.map((data)=>{
            return(
                <tr>{
                    column.map((v)=>{
                        return <td>{data[v]}</td>
                    })
                }
            </tr>
            )
        })
    }


    return (
        <table className="table">
            <thead>
                <tr>{ThData()}</tr>
            </thead>
            <tbody>
                {tdData()}
            </tbody>
       </table>
  )
}

export default DynamicTable;
